IF OBJECT_ID('dbo.PostCode', 'U') IS NOT NULL 
	DROP TABLE [dbo].PostCode
CREATE TABLE [dbo].PostCode (
				[Code] varchar (20),
                [City] varchar (100),
				[CountyCode] varchar(20),
				[Longitude] decimal (18,8),
				[Latitude] decimal (18,8),
				[County] varchar(100),
				[CountyRegion] varchar(100),
				[PostCodeKey] int IDENTITY (1, 1) NOT NULL,
	CONSTRAINT [PostCodePk] PRIMARY KEY CLUSTERED 
		([PostCodeKey] ASC) WITH (PAD_INDEX = OFF, 
								STATISTICS_NORECOMPUTE = OFF, 
								IGNORE_DUP_KEY = OFF, 
								ALLOW_ROW_LOCKS = ON, 
								ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]) ON [PRIMARY]


